import { useState, useEffect } from "react";
import axios from "axios";

import "./App.css";
import Browser from "./Browser/Browser";
import List from "./List/List";

function App() {
  const [data, setData] = useState([]);

  const getData = async () => {
    try {
      const response = await axios.get(
        "https://randomuser.me/api/?results=100"
      );
      console.log(response.data.results);
      setData(response.data.results);
    } catch (e) {
      console.log(e);
    }
  };

  const [search, setSearch] = useState('');
  const [icon, setIcon] = useState(false);

  const handleClear = () => {
    setSearch(''); 
  }

  useEffect(() => {
    search.length > 0 ? setIcon(true) : setIcon(false);
    const res = data.find(e => e.name.first.toLowerCase().includes(search.toLowerCase()))
    setData(res)
  }, [search]);

  useEffect(() => {
    console.log("oli");
    getData();
  }, []);

  return (
    <div className="App">
      <label>Browser</label>
        <div className="App">
          <TextField
            id="text"
            label="Buscar"
            value={search}
            variant="outlined"
            onChange={({ target }) => setSearch(target.value)}
            InputProps={{
              endAdornment: (
                <IconButton
                    edge="start"
                    onClick={handleClear}
                >
                    {!icon ? <SearchIcon /> : <CloseIcon />}
                </IconButton>
              ),
            }}
          />
      </div>

      <List data={data}></List>
    </div>
  );
}

export default App;
